import { Component } from '@angular/core';
import { LoginService } from '../login.service';
import { Router } from '@angular/router';
import { HttpClient, HttpHeaders } from '@angular/common/http';

@Component({
  selector: 'app-header',
  templateUrl: './header.component.html',
  styleUrls: ['./header.component.css'],
})
export class HeaderComponent {
  constructor(
    private loginService: LoginService,
    private router: Router,
    private http: HttpClient
  ) {}
  logout() {
    this.loginService.logout();
    this.router.navigate(['/login']);
  }

  showGraph() {
    //username = this.loginService.username;
    this.http.get(`http://localhost:8080/display_friends_network?username=${this.loginService.username.toString()}`).subscribe();
    //http://127.0.0.1:8080/display_friends_network?user=swati123
  }
}
<mat-toolbar style="background-color: #ED3237;">
  <img src="assets/favi.png" style="color: white; width: 2rem; height: 2rem; margin-right: 1rem;">
  <span style="font-weight: bold; color: ghostwhite;">MY University Social Network</span>
  <div style="display: inline-block; margin-left: auto;">
        <a (click)="showGraph()" mat-raised-button style="color: #ED3237; border-color: white;" target="_blank">
          <mat-icon>group_work</mat-icon>
      View Graph
      </a>
      &nbsp;&nbsp;
      <a (click)="logout()" mat-raised-button style="color: #ED3237; border-color: white;">
        <mat-icon>input</mat-icon>
        Logout
        </a>
  </div>
</mat-toolbar>
